import Axios from "axios"
import React, { useState } from "react"
const Submenu = ()=>{
    const [inpt,setinpt]=useState('')

    function Set(e){
        let data=e.target.value
        setinpt(data)
    }
    async function show(){
        let resdata= await Axios.get(`http://indianrailapi.com/api/v2/AllTrainOnStation/apikey/e23de61159ba3fe366d6ae2408af322b/StationCode/${inpt}/`)
        console.log(resdata)
    }
    return (
        <>
        <div className="accordion" id="accordionExample">
    <div id="collapseOne" className="collapse" aria-labelledby="headingTwo" data-parent="#accordionExample">
      <div className="card-body text-center">

  <label class="sr-only" for="inlineFormInputName2">Station code</label>
  <input type="text" class="form-control mb-2 mr-sm-2" value={inpt} onChange={Set} placeholder="e.g- JP" />

  <button type="button" class="btn btn-primary mb-2" onClick={show}>Submit</button>

      </div>

    </div>





</div>
        </>
    )
}
export default Submenu;
